shirec:=function(qu,D,N,prova: m:=70, limite:=5000)

//inizializzazione primi 2g valori
g,v,t:=shiAL(qu,D,N,prova:m:=m);
rec:=[];
m0:=2*g;
if m0 ge m then
return v,g;
end if;

K<x>:=PolynomialRing(ComplexField());

polcompl:=1;
for alpha in t do
polcompl:=polcompl*(x-alpha);
end for;
//polcompl;
coeff:=[];
if polcompl ne 1 then
for k in [1..2*g+1] do
c:=Coefficient(polcompl,k-1);
coeff[k]:=Floor((c+ComplexConjugate(c))/2+0.1);
end for;
else 
coeff[1]:=1;
end if;


for j in [1..m0] do
rec[j]:=v[j]-1-qu^j;
end for;//j

//default m:=70;
for j in [1..m-m0] do
e:=0;
for k in [1..m0] do
e:=e-coeff[k]*rec[j+k-1];
end for;

//coeff;rec;e;

rec[m0+j]:=e;
end for;//j

for j in [1..m] do
rec[j]:=rec[j]+1+qu^j;
end for;//j

return rec,g;
end function; //shirec




