shiALpoints:=function(q,i,D,N,prova) 
g,v:=shiAL(q,D,N,prova);
return v[i];
end function;

shiALgen:=function(D,N,prova) 
q:=2;
while IsDivisibleBy(D*N,q) do
q:=NextPrime(q);
end while;
g,v:=shiAL(q,D,N,prova);
return g;
end function;

shiALquot:=function(q,i,D,N,prova)
limite:=D*N;
PRI:=Factorization(limite);
pri:=#PRI;
d:=[];
if #prova eq 0 then
g,v:=shiAL(q,D,N,[{}]);
else
for m in prova do
A:={};
    for j in [1..pri] do
    if IsDivisibleBy(m,PRI[j][1]) then
    A:=A join {j};
    end if;
    end for;//j
Append(~d,A);
end for; //m
g,v:=shiAL(q,D,N,d);
end if;
return v[i];
end function;

